import React,{useState, useEffect} from "react";



const Coordinates = () => {
  const coordinate = useCoordinates();
  
  return(
    <div>
      <h1>Lat: {coordinate.lat}</h1>
      <h1>Long: {coordinate.long}</h1>
    </div> 
  )
 
}
  
export default Coordinates
